import React from "react";

function CityInput({city,handleCityInput}){
    return(<>
        <div class="inputCityDiv">
            <form action="#">
                <label for="city-input">How is the sky in: </label>
                <input type="text" id="city-input" value={city} onChange={(e)=>handleCityInput(e)}  />
            </form>
        </div>
    </>)
}

export default CityInput ;
